function laravelInterceptor(req, next) {
  const pusher = inject(PusherService);
  let headers = req.headers;
  if (pusher.socketID) {
    headers = headers.append("X-Socket-ID", pusher.socketID);
  }
  const newReq = req.clone({ headers });
  return next(newReq);
}

